package cn.cenjp.platform.vo;import java.math.BigDecimal;public class Info {    private Integer sendGood;    private Integer spikeCount;    private Double  turnOver;    private Integer dayUser;    private Integer incUser;    public Info(Integer sendGood, Integer spikeCount, Double turnOver, Integer dayUser, Integer incUser) {        this.sendGood = sendGood;        this.spikeCount = spikeCount;        this.turnOver = turnOver;        this.dayUser = dayUser;        this.incUser = incUser;    }    public Info() {    }    public Integer getSendGood() {        return sendGood;    }    public void setSendGood(Integer sendGood) {        this.sendGood = sendGood;    }    public Integer getSpikeCount() {        return spikeCount;    }    public void setSpikeCount(Integer spikeCount) {        this.spikeCount = spikeCount;    }    public Double getTurnOver() {        return turnOver;    }    public void setTurnOver(Double turnOver) {        this.turnOver = turnOver;    }    public Integer getDayUser() {        return dayUser;    }    public void setDayUser(Integer dayUser) {        this.dayUser = dayUser;    }    public Integer getIncUser() {        return incUser;    }    public void setIncUser(Integer incUser) {        this.incUser = incUser;    }    @Override    public String toString() {        return "Info{" +                "sendGood=" + sendGood +                ", spikeCount=" + spikeCount +                ", turnOver=" + turnOver +                ", dayUser=" + dayUser +                ", incUser=" + incUser +                '}';    }}